import React from 'react';
import ResponsiveNavBar from "../Partials/Header"



function Drive() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex flex-row py-32 px-8 justify-center text-black font-sans drop-shadow-xl">

        <div className=' flex flex-col items-center justify-center  py-16 w-auto px-20 ' >
                <h1 className='text-4xl font-bold italic text-black font-serif '>Already a Driver ?</h1>
                <p className='text-xl font-light italic text-black '>connect to your Driver Account</p>
                <button className='mt-12 text-white bg-cyan-500 hover:bg-cyan-600 focus:ring-4 focus:outline-none focus:ring-cyan-500 font-semibold rounded-md text-lg w-full sm:w-full px-5 py-2.5 text-center dark:bg-cyan-600 dark:hover:bg-cyan-700 dark:focus:ring-cyan-800'>Connect</button>
        </div>
        <div className=' flex items-center justify-center align-middle py-16 w-44 '><div className="text-gray-600 text-4xl italic font-semibold">Or</div></div>
        <div className=' flex flex-col items-center justify-center  py-16 w-auto px-20 '> 
                <h1 className='text-4xl font-bold italic text-black font-serif '>Become a Driver ?</h1>
                <p className='text-xl font-light italic text-black '>create  your Driver Account</p>
                <button className='mt-12 text-white bg-cyan-500 hover:bg-cyan-600 focus:ring-4 focus:outline-none focus:ring-cyan-500 font-semibold rounded-md text-lg w-full sm:w-full px-5 py-2.5 text-center dark:bg-cyan-600 dark:hover:bg-cyan-700 dark:focus:ring-cyan-800'>Create Account</button>
        </div>
        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Drive;
